import React, {Component} from 'react';

class Contact extends Component {
    render() {

        console.log(this.props.contact.col, this.props.col);
        if (this.props.contact.col == this.props.col) {
            return (

                <li>
                    {this.props.contact.name}
                </li>

            );
        } else {
            return false;
        }
    }
}

export default Contact;
